import React, { Component } from 'react'
import { GiCakeSlice } from "react-icons/gi";
import { MdFreeBreakfast } from "react-icons/md";
import { GiStorkDelivery } from "react-icons/gi";
import { GiPeanut } from "react-icons/gi";
import { RiKnifeLine } from "react-icons/ri";
export default class QuickSearchesdown extends Component {
    render() {
        return (
            <div>
                    <div className='container mt-5'>
                           <div className='row'>
                                  <div className='card card-body uparrow'>
                                         <div className='container'>
                                               {/* <div className='col-md-2'> */}
                                                    {/* <i class='far fa-arrow-alt-circle-up' style={{fontSize:'48px',marginLeft:'140px'}}></i> */}
                                                    <GiCakeSlice size='2rem' className='cap'/>
                                                    {/* <p className='bev'>Beverages</p> */}
                                                    {/* <span>Beverages</span> */}
                                               {/* </div> */}
                                               {/* <div className='col-md-2'> */}
                                                   {/* <i class='far fa-arrow-alt-circle-up' style={{fontSize:'48px',marginLeft:'140px'}}></i> */}
                                                   <MdFreeBreakfast size='2rem' className='cap cas'/>
                                                {/* </div> */}
                                                {/* <div className='col-md-2'> */}
                                                  {/* <i class='far fa-arrow-alt-circle-up' style={{fontSize:'48px',marginLeft:'140px'}}></i> */}
                                                  <GiStorkDelivery size='2rem' className='cap'/>
                                                {/* </div> */}
                                                {/* <div className='col-md-2'> */}
                                                    {/* <i class='far fa-arrow-alt-circle-up' style={{fontSize:'48px',marginLeft:'140px'}}></i> */}
                                                    <GiPeanut size='2rem' className='cap'/>
                                                {/* </div> */}
                                                {/* <div className='col-md-2'> */}
                                                {/* <i class='far fa-arrow-alt-circle-up' style={{fontSize:'48px',marginLeft:'140px'}}></i> */}
                                                <RiKnifeLine size='2rem' className='cap'/>
                                                 {/* </div> */}
                                         </div>
                                  </div>
                           </div>
                    </div>
            </div>
        )
    }
}
